import{_ as e,p as i,q as s,a1 as r}from"./framework-d81ad7e5.js";const t={},l=r('<ul><li><p><strong>Home</strong>: 是ActiveMQ管理控制台的首页，提供了一些常用的管理功能，如停止Broker、查看Broker状态、查看所有Destination、查看网络连接情况等。</p></li><li><p><strong>Queues</strong>: 显示所有队列的信息，包括队列名称、队列深度、已消费和未消费消息数量、消费者数量等，可以对队列进行删除、暂停、恢复等操作。</p></li><li><p><strong>Topics</strong>: 显示所有主题的信息，包括主题名称、已发送和未发送消息数量、订阅者数量等，可以对主题进行删除、暂停、恢复等操作。</p></li><li><p><strong>Subscribers</strong>: 显示所有订阅者的信息，包括订阅者ID、所订阅的主题、持久化状态、未消费和已消费的消息数量等，可以对订阅者进行删除、关闭、恢复等操作。</p></li><li><p><strong>Connections</strong>: 显示所有连接到Broker的客户端连接信息，包括连接ID、客户端ID、连接时间、最后活动时间、消费者数量等，可以对连接进行强制关闭、重新连接等操作。</p></li><li><p><strong>Network</strong>: 显示与其他Broker的网络连接信息，包括目标Broker、连接状态、发送和接收的消息数量等，可以对网络连接进行断开、重新连接等操作。</p></li><li><p><strong>Scheduled</strong>: 显示所有已经被调度但是还没有被执行的任务，可以对任务进行删除、修改等操作。</p></li><li><p><strong>Send</strong>: 提供发送消息的功能，可以选择目标队列或主题，填写消息内容、消息头等信息，进行消息的发送操作。</p></li></ul><h2 id="queues" tabindex="-1"><a class="header-anchor" href="#queues" aria-hidden="true">#</a> queues</h2><ul><li>Name：消息队列的名称。</li><li>Number Of Pending Messages：等待消费者处理的消息数量。</li><li>Number Of Consumers：当前连接到消息队列的消费者数量。</li><li>Messages Enqueued：消息队列收到的消息总数。</li><li>Messages Dequeued：消费者处理的消息总数。</li><li>Views：查看队列详细信息的链接，例如消息的详细信息、历史消息等。</li><li>Browse：查看队列中的所有消息，可以按照不同的排序方式对消息进行排序，也可以对消息进行删除或重新发送等操作。</li><li>Active Consumers：查看当前正在消费该队列的所有消费者信息，包括消费者的ID、连接信息、消费状态等。</li><li>Active Producers：查看当前正在向该队列发送消息的所有生产者信息，包括生产者的ID、连接信息、发送状态等。</li><li>Operations：执行队列操作的链接，例如删除队列、重新启动队列等。</li><li>Send To：可以向选定的队列发送消息。可以选择发送的消息的类型，例如文本或字节消息，并设置消息属性和有效期。</li><li>Purge：可以清空选定队列的所有消息，这个操作是不可逆的，请慎重使用。</li><li>Delete：可以删除选定的队列。删除队列时，所有该队列的消息将被删除，并且无法恢复。请确保在删除队列之前已经备份了所需的消息数据。</li><li>Pause：可以暂停选定队列的消息传递。这个操作可以让你在不删除队列的情况下停止消费消息，等到问题解决后再继续消费。</li></ul><h2 id="topics页说明" tabindex="-1"><a class="header-anchor" href="#topics页说明" aria-hidden="true">#</a> Topics页说明</h2><p>Name: 队列的名称。 Number Of Consumers: 监听此队列的消费者数量。 Messages Enqueued: 已经放入到队列中但是还没有被消费者消费的消息数量。 Messages Dequeued: 已经被消费者消费掉的消息数量。 Operations: 针对队列执行的操作。 Send To：将消息发送到队列中。可以选择消息的类型（text 或者 bytes）以及消息的优先级。</p><p>Active Subscribers：显示当前订阅了该队列的消费者列表，可以查看它们的详细信息并断开连接。</p><p>Active Producers：显示当前向该队列发送消息的生产者列表，可以查看它们的详细信息并断开连接。</p><p>Delete：删除该队列。注意，删除队列将删除所有与之相关的消息，这是一个不可逆的操作。</p><h2 id="subscribers页说明" tabindex="-1"><a class="header-anchor" href="#subscribers页说明" aria-hidden="true">#</a> Subscribers页说明</h2><p>Client ID：订阅的客户端ID。 Subscription Name：订阅的名称。 Connection ID：订阅所属的连接ID。 Destination：订阅的目的地，即所订阅的队列或主题。 Selector：订阅的消息过滤器。 Pending Queue Size：尚未分发的消息数，表示等待处理的消息数量，即还没有被消费者消费的消息数量。 Dispatched Queue Size：已经分发但还没有被消费的消息数，表示已经被调度（分发）给消费者处理的消息数量，但尚未被消费者确认处理完成的消息数量。 Dispatched Counter：已经成功分发并被消费的消息数，表示已经被消费者确认处理完成的消息数量。 Enqueue Counter：已经被加入队列的消息数。 Dequeue Counter：已经被消费的消息数。 Operations：可对订阅进行的操作，包括删除、恢复、暂停等。</p><h2 id="注意事项" tabindex="-1"><a class="header-anchor" href="#注意事项" aria-hidden="true">#</a> 注意事项:</h2><ul><li><strong>Pending Queue Size，dispatched queue size，dispatched counter</strong></li></ul><p>这三个指标都是用来衡量ActiveMQ消息队列中消息处理的情况的：</p><ul><li><p>Pending Queue Size：表示等待处理的消息数量，即还没有被消费者消费的消息数量。</p></li><li><p>Dispatched Queue Size：表示已经被调度（分发）给消费者处理的消息数量，但尚未被消费者确认处理完成的消息数量。</p></li><li><p>Dispatched Counter：表示已经被消费者确认处理完成的消息数量。</p></li><li><p>其中，Dispatched Queue Size和Dispatched Counter都是用来跟踪消息处理的进度的，Pending Queue Size则表示队列的积压情况。</p><ul><li><p>Pending Queue Size过大时，会导致队列中的消息堆积，可能会影响系统性能和可用性。</p></li><li><p>Dispatched Queue Size过大则表示已经分发但尚未确认处理完成的消息太多，可能会导致消费者处理不过来，从而影响系统吞吐量和延迟。</p></li><li><p>Dispatched Counter过大则表示已经处理完成的消息数量过多，可能会导致内存占用过高，也可能会影响队列的性能。</p></li></ul></li></ul>',14),n=[l];function u(o,a){return i(),s("div",null,n)}const c=e(t,[["render",u],["__file","activemq_admin.html.vue"]]);export{c as default};
